const fz = require('zigbee-herdsman-converters/converters/fromZigbee');
const tz = require('zigbee-herdsman-converters/converters/toZigbee');
const exposes = require('zigbee-herdsman-converters/lib/exposes');
const reporting = require('zigbee-herdsman-converters/lib/reporting');
const constants = require('zigbee-herdsman-converters/lib/constants');
const e = exposes.presets;
const ea = exposes.access;
const {calibrateAndPrecisionRoundOptions} = require('zigbee-herdsman-converters/lib/utils');



const tzLocal = {
	co2_config: {
        key: ['backlight', 'night_backlight', 'night_backlight_on', 'night_backlight_off', 'forced_recalibration', 'automatic_self_calibration', 'contrast'],
        convertSet: async (entity, key, rawValue, meta) => {
			const endpoint = meta.device.getEndpoint(1);
            const lookup = {'OFF': 0x00, 'ON': 0x01};
            const value = lookup.hasOwnProperty(rawValue) ? lookup[rawValue] : parseInt(rawValue, 10);
            const payloads = {
                backlight: ['msCO2', {0x0211: {value, type: 0x10}}],
				night_backlight: ['msCO2', {0x0401: {value, type: 0x10}}],
				night_backlight_on: ['msCO2', {0x0405: {value, type: 0x20}}],
				night_backlight_off: ['msCO2', {0x0406: {value, type: 0x20}}],
                forced_recalibration: ['msCO2', {0x0202: {value, type: 0x10}}],
                automatic_self_calibration: ['msCO2', {0x0402: {value, type: 0x10}}],
				contrast: ['msCO2', {0x0445: {value, type: 0x20}}],
            };
            await endpoint.write(payloads[key][0], payloads[key][1]);
            return {
                state: {[key]: rawValue},
            };
        },
    },
	temperature_config: {
        key: ['temperature_offset'],
        convertSet: async (entity, key, rawValue, meta) => {
			const endpoint = meta.device.getEndpoint(2);
            const value = parseFloat(rawValue)*10;
            const payloads = {
                temperature_offset: ['msTemperatureMeasurement', {0x0210: {value, type: 0x29}}],
            };
            await endpoint.write(payloads[key][0], payloads[key][1]);
            return {
                state: {[key]: rawValue},
            };
        },
    },
	humidity_config: {
        key: ['humidity_offset'],
        convertSet: async (entity, key, rawValue, meta) => {
			const endpoint = meta.device.getEndpoint(2);
            const value = parseInt(rawValue, 10);
            const payloads = {
                humidity_offset: ['msRelativeHumidity', {0x0210: {value, type: 0x29}}],
            };
            await endpoint.write(payloads[key][0], payloads[key][1]);
            return {
                state: {[key]: rawValue},
            };
        },
    },
	co2_gasstat_config: {
        key: ['high_gas', 'low_gas', 'enable_gas', 'invert_logic_gas'],
        convertSet: async (entity, key, rawValue, meta) => {
			const endpoint = meta.device.getEndpoint(1);
            const lookup = {'OFF': 0x00, 'ON': 0x01};
            const value = lookup.hasOwnProperty(rawValue) ? lookup[rawValue] : parseInt(rawValue, 10);
            const payloads = {
                high_gas: ['msCO2', {0x0221: {value, type: 0x21}}],
                low_gas: ['msCO2', {0x0222: {value, type: 0x21}}],
				enable_gas: ['msCO2', {0x0220: {value, type: 0x10}}],
				invert_logic_gas: ['msCO2', {0x0225: {value, type: 0x10}}],
            };
            await endpoint.write(payloads[key][0], payloads[key][1]);
            return {
                state: {[key]: rawValue},
            };
        },
    },
	/*
	identify_config: {
        key: ['identify'],
        convertSet: async (entity, key, rawValue, meta) => {
			const endpoint = meta.device.getEndpoint(1);
            const value = parseInt(rawValue, 10);
            const payloads = {
                identify: ['genIdentify', {0x0000: {value, type: 0x21}}],
            };
            await endpoint.write(payloads[key][0], payloads[key][1]);
            return {
                state: {[key]: rawValue},
            };
        },
    },
	*/
};





const fzLocal = {
	co2: {
        cluster: 'msCO2',
        type: ['attributeReport', 'readResponse'],
        convert: (model, msg, publish, options, meta) => {
			if (msg.data.hasOwnProperty('measuredValue')) {
				return {co2: Math.round(msg.data.measuredValue * 1000000)};
			}
        },
    },
	co2_config: {
        cluster: 'msCO2',
        type: ['attributeReport', 'readResponse'],
        convert: (model, msg, publish, options, meta) => {
            const result = {};
            if (msg.data.hasOwnProperty(0x0211)) {
                result.backlight = ['OFF', 'ON'][msg.data[0x0211]];
            }
			if (msg.data.hasOwnProperty(0x0401)) {
                result.night_backlight = ['OFF', 'ON'][msg.data[0x0401]];
            }
			if (msg.data.hasOwnProperty(0x0405)) {
                result.night_backlight_on = msg.data[0x0405];
            }
			if (msg.data.hasOwnProperty(0x0406)) {
                result.night_backlight_off = msg.data[0x0406];
            }
            if (msg.data.hasOwnProperty(0x0202)) {
                result.forced_recalibration = ['OFF', 'ON'][msg.data[0x0202]];
            }
            if (msg.data.hasOwnProperty(0x0402)) {
                result.automatic_self_calibration = ['OFF', 'ON'][msg.data[0x0402]];
            }
			if (msg.data.hasOwnProperty(0x0444)) {
                result.co2_error_read = msg.data[0x0444];
            }
			if (msg.data.hasOwnProperty(0x0445)) {
                result.contrast = msg.data[0x0445];
            }
            return result;
        },
    },
	temperature_config: {
        cluster: 'msTemperatureMeasurement',
        type: ['attributeReport', 'readResponse'],
        convert: (model, msg, publish, options, meta) => {
            const result = {};
            if (msg.data.hasOwnProperty(0x0210)) {
                result.temperature_offset = parseFloat(msg.data[0x0210])/10.0;
            }
            return result;
        },
    },
    humidity_config: {
        cluster: 'msRelativeHumidity',
        type: ['attributeReport', 'readResponse'],
        convert: (model, msg, publish, options, meta) => {
            const result = {};
            if (msg.data.hasOwnProperty(0x0210)) {
                result.humidity_offset = msg.data[0x0210];
            }
            return result;
        },
    },
	co2_gasstat_config: {
        cluster: 'msCO2',
        type: ['attributeReport', 'readResponse'],
        convert: (model, msg, publish, options, meta) => {
            const result = {};
            if (msg.data.hasOwnProperty(0x0221)) {
                result.high_gas = msg.data[0x0221];
            }
			if (msg.data.hasOwnProperty(0x0222)) {
                result.low_gas = msg.data[0x0222];
            }
            if (msg.data.hasOwnProperty(0x0220)) {
                result.enable_gas = ['OFF', 'ON'][msg.data[0x0220]];
            }
			if (msg.data.hasOwnProperty(0x0225)) {
                result.invert_logic_gas = ['OFF', 'ON'][msg.data[0x0225]];
            }
            return result;
        },
    },
	/*
	identify_config: {
        cluster: 'genIdentify',
        type: ['attributeReport', 'readResponse'],
        convert: (model, msg, publish, options, meta) => {
            const result = {};
            if (msg.data.hasOwnProperty(0x0000)) {
                result.identify = msg.data[0x0000];
            }
            return result;
        },
    },
	*/
};

const definition = {
        zigbeeModel: ['EFEKTA_Pixel_Open_Air'],
        model: 'EFEKTA_Pixel_Open_Air',
        vendor: 'EFEKTA',
        description: '[CO2 Monitor with LCD Display, temperature and humidity, date and time.](http://efektalab.com/Pixel_Open_AIR)',
        fromZigbee: [fz.temperature, fz.humidity, fzLocal.co2, fzLocal.co2_config,
            fzLocal.temperature_config, fzLocal.humidity_config, fzLocal.co2_gasstat_config],
        toZigbee: [tz.factory_reset, tzLocal.co2_config, tzLocal.temperature_config, tzLocal.humidity_config, tzLocal.co2_gasstat_config],
        configure: async (device, coordinatorEndpoint, logger) => {
            const firstendpoint = device.getEndpoint(1);
			const secondendpoint = device.getEndpoint(2);
			await reporting.bind(firstendpoint, coordinatorEndpoint, ['genTime', 'genIdentify', 'msCO2']);
		    await reporting.bind(secondendpoint, coordinatorEndpoint, ['msTemperatureMeasurement', 'msRelativeHumidity']);
			const payload1 = [{attribute: {ID: 0x0000, type: 0x39},
            minimumReportInterval: 15, maximumReportInterval: 600, reportableChange: 0.000001}];
            await firstendpoint.configureReporting('msCO2', payload1);
			const payload2 = [{attribute: {ID: 0x0000, type: 0x29},
            minimumReportInterval: 15, maximumReportInterval: 600, reportableChange: 25}];
            await secondendpoint.configureReporting('msTemperatureMeasurement', payload2);
			const payload3 = [{attribute: {ID: 0x0000, type: 0x21},
            minimumReportInterval: 15, maximumReportInterval: 600, reportableChange: 50}];
			await secondendpoint.configureReporting('msRelativeHumidity', payload3);
        },
        icon: 'data:image/png;base64,',
        exposes: [e.co2(), e.temperature(), e.humidity(),
            exposes.binary('backlight', ea.STATE_SET, 'ON', 'OFF')
			    .withDescription('Enable or Disable Brightness of the Display'),
			exposes.binary('night_backlight', ea.STATE_SET, 'ON', 'OFF')
			    .withDescription('Enable Night Mode'),
			exposes.numeric('night_backlight_on', ea.STATE_SET).withUnit('Hour').withDescription('Night Mode On')
                .withValueMin(0).withValueMax(23),
			exposes.numeric('night_backlight_off', ea.STATE_SET).withUnit('Hour').withDescription('Night Mode Off')
                .withValueMin(0).withValueMax(23),
			exposes.numeric('contrast', ea.STATE_SET).withDescription('Display Contrast')
                .withValueMin(0).withValueMax(40),
			exposes.numeric('temperature_offset', ea.STATE_SET).withUnit('C').withValueStep(0.1).withDescription('Adjust temperature')
                .withValueMin(-50.0).withValueMax(50.0),
            exposes.numeric('humidity_offset', ea.STATE_SET).withUnit('%').withDescription('Adjust humidity')
                .withValueMin(-50).withValueMax(50),
			exposes.binary('forced_recalibration', ea.STATE_SET, 'ON', 'OFF')
			    .withDescription('Start FRC (Perform Forced Recalibration of the CO2 Sensor on fresh air)'),
			exposes.binary('automatic_self_calibration', ea.STATE_SET, 'ON', 'OFF').withDescription('Automatic self calibration'),
			exposes.numeric('co2_error_read', ea.STATE).withDescription('CO2 Error Read'),
			exposes.binary('enable_gas', ea.STATE_SET, 'ON', 'OFF').withDescription('Enable CO2 Gas Control'),
			exposes.binary('invert_logic_gas', ea.STATE_SET, 'ON', 'OFF').withDescription('Enable invert logic CO2 Gas Control'),
            exposes.numeric('high_gas', ea.STATE_SET).withUnit('ppm').withDescription('Setting High CO2 Gas Border')
                .withValueMin(400).withValueMax(5000),
            exposes.numeric('low_gas', ea.STATE_SET).withUnit('ppm').withDescription('Setting Low CO2 Gas Border')
                .withValueMin(400).withValueMax(5000)],
};

module.exports = definition;